import React, { Component } from 'react';
import headerLogo from './logo.jpg';
import './style.css';
import { Menu, Icon } from 'antd'

export default class AppHeader extends Component {
    render() {
        return (
            <div>
                <img src={headerLogo} className="app-header-logo" />
                {/* horizontal代表横向展示 */}
                <Menu mode="horizontal">
                    <Menu.Item key="mail">
                        <Icon type="mail" />
                        VOA low speed English
                    </Menu.Item>
                </Menu>
            </div>
                );
            };
        }
